import "./App.css";
import Header from "./components/Header";
import { RouterProvider } from "react-router-dom";
import router from "./router/router";

function App() {
  return (
    <div className="App">
      <RouterProvider router={router}>
        <div className="App">
          <Header />
        </div>
      </RouterProvider>
    </div>
  );
}

export default App;
